#!/usr/bin/env python
# -*- coding: utf-8 -*-

"""
Tests for the 'UMSI' metric (m9).
"""


# ----------------------------------------------------------------------------
# Imports
# ----------------------------------------------------------------------------

# Standard library modules
import pathlib
from typing import Any, List, Optional, Union

# Third-party modules
import pytest

# First-party modules
from aim.common import image_utils
from aim.metrics.m9.m9_umsi import Metric
from tests.common.constants import DATA_TESTS_DIR

# ----------------------------------------------------------------------------
# Metadata
# ----------------------------------------------------------------------------

__author__ = "Markku Laine"
__date__ = "2021-11-05"
__email__ = "markku.laine@aalto.fi"
__version__ = "1.0"


# ----------------------------------------------------------------------------
# Tests
# ----------------------------------------------------------------------------


@pytest.mark.parametrize(
    ["input_value", "expected_result"],
    [
        (
            "50.png",
            [
                "",
                "",
            ],
        ),
        (
            "COCO_val2014_000000001700.png",
            [
                "",
                "",
            ],
        ),
    ],
)
def test_umsi_desktop(input_value: str, expected_result: List[Any]) -> None:
    """
    Test UMSI (desktop GUIs).

    Args:
        input_value: GUI image file name
        expected_result: Expected result (list of measures)
    """
    # Build GUI image file path
    gui_image_filepath: pathlib.Path = (
        pathlib.Path(DATA_TESTS_DIR) / input_value
    )

    # Read GUI image (PNG)
    gui_image_png_base64: str = image_utils.read_image(gui_image_filepath)

    # Execute metric
    result: Optional[List[Union[int, float, str]]] = Metric.execute_metric(
        gui_image_png_base64
    )

    # Test result
    if (
        result is not None
        and isinstance(result[0], str)
        and isinstance(result[1], str)
    ):
        assert result[0] == expected_result[0]
        assert result[1] == expected_result[1]
